import React from "react";
import { View, Text, Image, StyleSheet } from "react-native";
import tw from "tailwind-react-native-classnames";
import Card from "./Card";
interface Props {
  opponent?: boolean;
}
const Deck: React.FC<Props> = (Props) => {
  const { opponent } = Props;
  return (
    <View style={styles.container}>
      <Card width={100} height={140} id={0} flipped={!opponent} deck />
      <Card width={100} height={140} id={1} flipped={!opponent} deck />
      <Card width={100} height={140} id={2} flipped={!opponent} deck />
      <Card width={100} height={140} id={3} flipped={!opponent} deck />
      <Card width={100} height={140} id={4} flipped={!opponent} deck />
      <Card width={100} height={140} id={5} flipped={!opponent} deck />
    </View>
  );
};
const styles = StyleSheet.create({
  container: {
    display: "flex",
    flexDirection: "row",
  },
});
export default Deck;
